import { Component } from 'react';
import Button from '@mui/material/Button';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';

class DeleteDataset extends Component {
    constructor(props) {
        super(props)
        this.state = {
            httpMethod: 'DELETE',
            open: false
        };

        this.handelClose = this.handelClose.bind(this)
        this.handelSubmit = this.handelSubmit.bind(this)
    }

    handelSubmit(e) {
        e.preventDefault();
        console.log(this.state.datasetConfigUserInput)
        this.props.handleSendRequest(JSON.stringify(this.props.datasetConfigJSON), this.state.httpMethod)
    }

    handleClickOpen = () => {
        this.setState({ open: true });
    };

    handleClose = () => {
        this.setState({ open: false });
    };

    render() {
        return (


            <div>
                <form>
                    <h2>Do you want to Delete {this.props.datasetConfigJSON.name}?</h2>
                    <button onClick={this.handelSubmit}>Yes</button>
                    <button onClick={this.handelClose}>No</button>
                </form>



                <Button variant="outlined" onClick={this.handleClickOpen}>
                    Open alert dialog
                </Button>
                <Dialog
                    open={this.state.open}
                    onClose={this.handleClose}
                    aria-labelledby="alert-dialog-title"
                    aria-describedby="alert-dialog-description"
                >
                    <DialogTitle id="alert-dialog-title">
                        {"Use Google's location service?"}
                    </DialogTitle>
                    <DialogContent>
                        <DialogContentText id="alert-dialog-description">
                            Let Google help apps determine location. This means sending anonymous
                            location data to Google, even when no apps are running.
                        </DialogContentText>
                    </DialogContent>
                    <DialogActions>
                        <Button onClick={this.handleClose}>Disagree</Button>
                        <Button onClick={this.handleClose} autoFocus>
                            Agree
                        </Button>
                    </DialogActions>
                </Dialog>



            </div>



        )
    }
}


export default DeleteDataset
